import React from 'react';
import styles from './MenuList.module.css';

import MenuItem from './MenuItem/MenuItem';

const MenuList = props => {
  return (
    <div className={styles.MenuList}>
      <MenuItem
        click={props.hideBar}
        name="Dashboard"
        to="/"
        icon="fas fa-tachometer-alt"
        exact
      />
      <MenuItem
        click={props.hideBar}
        name="New Jobs"
        to="/jobs"
        icon="fas fa-briefcase"
      />
      <MenuItem
        click={props.hideBar}
        name="Doctors"
        to="/doctors"
        number="46"
      />
      <MenuItem click={props.hideBar} name="Nurses" to="/nurses" number="99+" />
    </div>
  );
};

export default MenuList;
